Game Description:
******************
Vector is an exciting, arcade-style game featuring you as the exceptional free runner who wont be held down by the system. The game opens with a view into a totalitarian world where freedom and individually is nothing more than a distant dream. But the heart of a freerunner is strong, and you soon break free.

